import './App.scss';
import Footer from './components/Footer';
import { Router, Route, Switch, BrowserRouter, Link } from "react-router-dom";
import Activities from './screens/Activity';
import Mission from './screens/Mission';
import Site from './screens/Site';
import Contact from './screens/Contact';
import Reservations from './screens/Reservations';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <video id="background-video" autoPlay loop muted type="video/mp4">
          <source src="canoe-video.mp4" />
          Sorry this video is unavailable
        </video>
        <div className="navbar">
          <img className="logo" src="logo.png" />
          <ul className="list-action">
            <Link to="/mission"><li className="action-li">Notre mission</li></Link>
            <Link to="/activites"><li className="action-li">Les activités</li></Link>
            <Link to="/site"><li className="action-li">Le site</li></Link>
            <Link to="/reservations"><li className="action-li">Réservations</li></Link>
            <Link to="/contact"><li className="action-li">Nous contacter</li></Link>
          </ul>
        </div>
        <button className="dispo-button">
          Voir nos disponibilités pour la saison 2021
        </button>
          <Route path="/mission" component={Mission} />
          <Route path="/activites" component={Activities} />
          <Route path="/site" component={Site} />
          <Route path="/reservations" component={Reservations} /> 
          <Route path="/contact" component={Contact} />
        <footer>
          <Footer />
        </footer>
      </div>

    </BrowserRouter>
  );
}

export default App;
